import axios from 'axios'
import * as actionTypes from './actionTypes'

export const showDownload = () => ({
  type: actionTypes.SHOW_DOWNLOAD
})

export const closeDownload = () => ({
  type: actionTypes.CLOSE_DOWNLOAD
})

export const showBig = () => ({
  type: actionTypes.SHOW_BIG
})

export const hiddenBig = () => ({
  type: actionTypes.HIDDEN_BIG
})

export const getNote = () => {
  return dispatch => {
    axios.get('/api/note.json').then(() => {
      console.log('succ')
    })
  }
}
